  static propTypes = {
    text: PropTypes.string
  };

  static defaultProps = {};

  shouldComponentUpdate = shouldPureComponentUpdate;

  render() {
    return (
       <div style={casinoCoordStyle}>
          {this.props.text}
       </div>
    );
  }
}
